import { BrowserRouter, Routes, Route } from "react-router-dom";

function App(){
  return (
    <BrowserRouter>
      <div>
        <Routes>
          <Route path="/" component="{<ChildrenList/>}"/>
          <Route path="*" component="{<NotFound/>}"/>
        </Routes>
      </div>
    </BrowserRouter>
  )
}

export default App;
